local function huff_decode_bits(state, bits, dst)
    local code = huff_decode_codes[state.code + 1][bits + 1]

    -- invalid state
    if code[HUFF_DECODE_FAILURE_INDEX] then
        return
    end

    local sym = code[HUFF_DECODE_SYMBOL_INDEX]

    if sym then
        dst[#dst + 1] = str_char(sym)
    end

    state.ending = code[HUFF_DECODE_ENDING_INDEX]
    state.code = code[HUFF_DECODE_NEXT_STATE_INDEX]

    return true
end


function _M:decode(src, dst, last)
    local byte
    local bits

    for i = 1, #src do
        byte = str_byte(src, i)
        bits = band(brshift(byte, 4), 0xf)

        if not huff_decode_bits(self, bits, dst) then
            return nil, str_format("bad code 0x%x", bits)
        end

        bits = band(byte, 0xf)

        if not huff_decode_bits(self, bits, dst) then
            return nil, str_format("bad code 0x%x", bits)
        end
    end

    if last and not self.ending then
        return nil, str_format("incomplete code 0x%x", byte)
    end

    return true
end


function _M:reset()
    self.code = 0x0
    self.ending = false
end


-- create a huffman decoding state.
function _M.new_state()
    return setmetatable({ code = 0x0, ending = false }, mt)
end


return _M
